    false,nt"url": null,nt"notes": "This narrative report for Bear River Migratory
    Bird Refuge outlines Refuge accomplishments from November of 1941 through January
    of 1942. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including waterbirds, upland game birds, furbearers,
    predators, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments and collections and receipts. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, hunting, and violations. Photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
